import { __decorate } from "tslib";
import { Component } from '@angular/core';
let AdministracaoComponent = class AdministracaoComponent {
    constructor(api) {
        this.api = api;
        this.arquivos = [];
    }
    async enviarArquivo() {
        try {
            const resposta = await this.api.importarTabelasFIPEAsync(this.arquivos);
        }
        catch (error) {
        }
        finally {
            this.arquivos = [];
        }
    }
};
AdministracaoComponent = __decorate([
    Component({
        selector: 'app-administracao',
        templateUrl: './administracao.component.html',
        styleUrls: ['./administracao.component.scss'],
    })
], AdministracaoComponent);
export { AdministracaoComponent };
